ATTRIBUTE.VALUE:
DELETE FROM FCST_FUTURE_EVENTS WHERE 
customer_ship_date >=(
select  min(d1.day_date)  as DAY_DATE
from day_dimension d1
where to_char(d1.CY_YEAR_YYYY) || substr('00'||to_char(d1.CY_MONTH_NUM),length('00'||to_char(d1.CY_MONTH_NUM))-1,2)  in 
(
select to_char(d2.CY_YEAR_YYYY) || substr('00'||to_char(d2.CY_MONTH_NUM),length('00'||to_char(d2.CY_MONTH_NUM))-1,2)  
from day_dimension d2
where d2.day_date = trunc(sysdate)
 ) 
)
AND  UPDATE_USERID = 'ETL_LOAD_HSF_TRAK_EVENTS';
commit;
